import React from "react";
import '../Footer/Footer.css'
const Footer = () => {
    return(
        <form className="footer">
            <h1 className="Logo">
                починим.ру
            </h1>
            <div className="goupOfMediaButtons">
                <button className="media">
                <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none">
  <path d="M17.2137 13.3282L17.8356 9.23302H13.9452V6.5767C13.9452 5.45607 14.4877 4.36311 16.2301 4.36311H18V0.876705C18 0.876705 16.3945 0.600006 14.8603 0.600006C11.6548 0.600006 9.56164 2.5618 9.56164 6.11185V9.23302H6V13.3282H9.56164V23.2285C10.2767 23.3419 11.0082 23.4 11.7534 23.4C12.4986 23.4 13.2301 23.3419 13.9452 23.2285V13.3282H17.2137Z" fill="white"/>
</svg>
                </button>
                <button className="media">
                    
                </button>
                <button className="media">
                    
                </button>
            </div>
        </form>
    );
}

export default Footer;
